var WarnHelper = {

    animationSeconds: 1,
    waitSeconds: 3,
    injected: false,

    injectCSS: function() {
        var st = document.createElement("style");
        st.innerHTML = `
        #triggerwarn {
            object-fit: contain;
            max-height: 30vmax;
            top: 25vmin;
            opacity: 0;
            transition: opacity ` + this.animationSeconds + `s ease;
        }
        #triggerwarn.show {
            opacity: 1;
        }
        `;
        document.head.append(st);
    },

    injectHTML: function() {
        var outer = document.createElement("img");
        outer.id = "triggerwarn";
        outer.setAttribute("src", `
        data:image/png;base64,
        `);
        document.body.append(outer);
    },

    Show: function(callback) {
        // prepare it
        var self = WarnHelper;
        if(!self.injected) {
            self.injected = true;
            self.injectCSS();
            self.injectHTML();
        }
        // show it
        $("#triggerwarn").addClass("show");
        // wait some time
        setTimeout(() => {
            // hide it & wait again
            $("#triggerwarn").removeClass("show");
            setTimeout(() => {
                // call next
                callback();
            }, this.animationSeconds * 1000);
        }, this.waitSeconds * 1000);
    }
};